import React from "react";


function Navbar() {
  return(
    <nav>
      <label class="logo">Hello</label>
      <ul>
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Services</a></li>

      </ul>
    </nav>
  )
}

export default Navbar;
